import React from "react";

const Home =() => (
<div>
    <h1>Welcome to my Portfolio page</h1>
    <nav>
        <ul>
            <li><a href="#about">About</a></li>
            <li><a href="#projects">Projects</a></li>
            <li><a href="#skills">Skills</a></li>
        </ul>
    </nav>
    This is umamaheswari and i'm a Front end developer. 
</div>
);
export default Home;
